import React, { useState, useEffect, useRef } from 'react';
import { ResponsiveContainer, Tooltip, Rectangle, XAxis, YAxis, ScatterChart, Scatter } from 'recharts';
import axios from 'axios';

const api = axios.create({
  baseURL: process.env.REACT_APP_API_URL,
  withCredentials: true,
});

const MyComponent = () => {
    const [data, setData] = useState(null); // Step 1: Initialize state

    useEffect(() => {
        // Step 2: Fetch data with Axios
        const fetchData = async () => {
          try {
            const response = await api.get('/get-user-heatmap'); // Update with your endpoint
            setData(response.data);
          } catch (error) {
            console.error('Error fetching data:', error);
          }
        };
    
        fetchData();
      }, []);


      return (
        <div>
          {data ? (
            <pre>{JSON.stringify(data, null, 2)}</pre> // Step 3: Display the data
          ) : (
            'Loading...'
          )}
        </div>
      );
    };
    
    export default MyComponent;
